# -*- coding: utf-8 -*-from log import logclass SymbolReferences():    """     """    def __init__(self):        list_references = []            def add_reference(self, symb_reference):        list_references.append(symb_reference)            def find_signifiance(self, symbol):        for symb_ref in list_references:            if self._is_same_symbol(symb_ref, symbol):                return symb_ref.signifiance        return None        def _is_same_symbol(self, symb_1, symb_2):        if symb_1.width != symb_2.width or symb_1.height != symb_2.height:            return False        if symb_1.flat_list_ink != symb_2.flat_list_ink:            return False        return True                  